import React from "react";
import { Query } from "react-apollo";
import { MOVIE_DETAILS } from "./queries";

const Detail = ({
  match: {
    params: { movieId }
  }
}) => {
  <Query query={MOVIE_DETAILS}>
    {({ loading, error, data }) => {
      if (loading) return "loading";
    }}
  </Query>;
};

export default Detail;
